import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-beneficiario-table',
  templateUrl: './beneficiario-table.component.html',
  styleUrls: []
})
export class BeneficiarioTableComponent implements OnInit {
  @Input() public benificiario: Array<GetBenificiarioResponse> = [];
  @Output() public benificiarioEvent = new EventEmitter<EditBenificiarioAction>();
  @Output() public deleteBenificiarioEvent =
    new EventEmitter<DeleteBenificiarioAction>();
  public benificiarioSelected!: GetBenificiarioResponse;
  constructor() { }

  ngOnInit() {
  }

}
